import React from 'react';
import TelaUm from './TelaUm';
import { Box } from '@material-ui/core';

function BaseFormulario() {
    return (
        <Box
            sx={{
                width: 550,
                height: 763,
                backgroundColor: 'pink',
                borderRadius: 5,
                padding: 5,
            }}
        >
            <Box
                sx={{
                    width: 550,
                    height: 763,
                    backgroundColor: 'pink',
                    borderRadius: 5,
                    padding: 5,
                }}
                centered
            >
                <TelaUm />
            </Box>
        </Box>
    );
}


export default BaseFormulario;
